txt:
The Great Plains are the westernmost portion of the vast North American Interior Plains, which extend east to the Appalachian Plateau. The United States Geological Survey divides the Great Plains in the United States into ten physiographic subdivisions:

Missouri Coteau or Missouri Plateau (which also extends into Canada), glaciated – east central South Dakota, northern and eastern North Dakota and northeastern Montana;
Coteau du Missouri, unglaciated – western South Dakota, northeastern Wyoming, southwestern North Dakota and southeastern Montana;
Black Hills – western South Dakota;
High Plains – southeastern Wyoming, southwestern South Dakota, western Nebraska (including the Sand Hills), eastern Colorado, western Kansas, western Oklahoma, eastern New Mexico, and northwestern Texas (including the Llano Estacado and Texas Panhandle);
Plains Border – central Kansas and northern Oklahoma (including the Flint, Red and Smoky Hills);
Colorado Piedmont – eastern Colorado;
Raton section – northeastern New Mexico;
Pecos Valley – eastern New Mexico;
Edwards Plateau – south central Texas; and
Central Texas section – central Texas.Further to this can be added Canadian physiographic sub-regions such as the Alberta Plain, Cypress Hills, Manitoba Escarpment (eastward), Manitoba Plain, Missouri Coteau (shared), Rocky Mountain Foothills (eastward), and Saskatchewan Plain.The Great Plains consist of a broad stretch of country underlain by nearly horizontal strata extending westward from the 97th meridian west to the base of the Rocky Mountains, a distance of 300 to 500 miles (480 to 800 km). It extends northward from the Mexican boundary far into Canada. Although the altitude of the plains increases gradually from 600 or 1,200 ft (370 m) on the east to 4,000–5,000 or 6,000 feet (1,800 m) near the mountains, the local relief is generally small. The semi-arid climate excludes tree growth and opens far-reaching views.The plains are by no means a simple unit. They are of diverse structure and of various stages of erosional development. They are occasionally interrupted by buttes and escarpments. They are frequently broken by valleys. Yet on the whole, a broadly extended surface of moderate relief so often prevails that the name, Great Plains, for the region as a whole is well-deserved.The western boundary of the plains is usually well-defined by the abrupt ascent of the mountains. The eastern boundary of the plains (in the United States) is more climatic than topographic. The line of 20 inches (51 cm) of annual rainfall trends a little east of northward near the 97th meridian. If a boundary must be drawn where nature presents only a gradual transition, this rainfall line may be taken to divide the drier plains from the moister prairies. However, in Canada the eastern boundary of the plains is well defined by the presence of the Canadian Shield to the northeast.
The plains (within the United States) may be described in northern, intermediate, central and southern sections, in relation to certain peculiar features.  In Canada, no such division is used: the climatic and vegetation regions are more impactful on human settlement than mere topography, and therefore the region is split into (from north to south), the taiga plains, boreal plains, aspen parkland, and prairie ecoregion regions.

The wilaya of Ouled Djellal is located in the Algerian Sahara, its area 131,220 km²   .
It is delimited by:

to the north by the M'sila Province;
to the east by the Biskra Province and El M'Ghair Province;
to the west by the Djelfa Province;
and to the south by the Ouargla Province.

Area 18,584 km2 (7,173 sq. miles), the largest province of Southeast Anatolia with:

Adıyaman Province to the north;
Syria to the south;
Mardin Province and Diyarbakır Province to the east;
Gaziantep Province to the west;Şanlıurfa includes several major components of the Southeastern Anatolia Project (in Turkish  Güneydogu Anadolu Projesi (GAP)) designed to:

exploit the hydropower potential of the Tigris and Euphrates Rivers;
dramatically expand irrigation for agriculture; and
develop the economy of the region.This very large-scale, state-sponsored development project involved the damming, redirecting, hydroelectric tapping and other use of rivers in this broad, semi-arid region. (The rivers then flow into Syria and Iraq).  The GAP includes 22 dams and water supply for 1.8 million hectares for agricultural areas.
